/// ACTION函数检索语法分析表的信息
ActionNode* ACTION(State state, TupleNode *tupleNode)
{
    for(int i = 0;
        //actionTable[state][i].m_received == tupleNode->m_tuple.m_kind
        actionTable[state][i].m_received != TOKEN_NULL;
        i++)       // 如果当前
    {
        if(actionTable[state][i].m_received == tupleNode->m_tuple.m_kind)
        {
            return &actionTable[state][i];
        }
    }

    return NULL;
}



/// 状态转移函数  -=> 归约后转移到新的扎
GoToNode* GOTO(int state, SyntaxKind  receive)
{
    for(int i = 0;
        gotoTable[state][i].m_receive != SYN_NULL;
        i++)
    {
        if(gotoTable[state][i].m_receive == receive)
        {
            return &gotoTable[state][i];
        }
    }

    return NULL;
}
